import React from "react";
import "../navigation/navigation.css";

class Navigation extends React.Component {

  constructor(props) {
    super(props);
  }

  render() {
    return (
        <nav id="navigation" class="navbar navbar-inverse menu-background sht-navbar">
        </nav>
    )
  }
} 

export default Navigation;
